export default function QRcode() {
  return (
    <>
      <img
        src="https://www.nhb.gov.sg/nationalmuseum/-/media/nms2017/image/visit-us/httpsgogovsgnmsvouch.png?h=125&w=137"
        alt="QR code" className="footerIcon"
      />
      <img
        src="https://www.nhb.gov.sg/nationalmuseum/-/media/nms2017/image/visit-us/mobile-with-dome-bot.png?h=138&w=82"
        alt="QR code guide" className="footerIcon"
      />
    </>
  );
}
